import React from "react";

const TagList = () => {
  return (
    <div class="tags">
      <a href="">Java</a>

      <a href="">Mobile App Development</a>

      <a href="">Mobile App Testing</a>

      <a href="">Software Development</a>

      <a href="">Twitter API</a>
    </div>
  );
};

export default TagList;
